import React, { useState, useEffect } from 'react';

import StoryItem from "../components/story-item";

import "./stories.css";

const StoriesView = () => {
  const [slugList, setslugList] = useState(null);

  useEffect(() => {
    getStoriesView();
  }, []);

  const getStoriesView = async () => {
    const response = await fetch("https://www.thequint.com/api/v1/stories");
    const data = await response.json();

    setslugList(data.stories);
  };

  return (
    <div className="story-slugList">
      {
        slugList && slugList.map((item, index) => <StoryItem key={index} story={item} />)
      }
    </div>
  );
};
    
    export default StoriesView;
